import React from 'react';
import './Profile.css';

function Profile() {
  return (
    <div className="profile">
      <h1>My Profile</h1>
      <ul className="profile-menu">
        <li>My Programs</li>
        <li>My Diet Plans</li>
        <li>My Articles</li>
        <li>My Medical History</li>
        <li>My Progress</li>
        <li>My Trainer</li>
        <li>My Subscription</li>
      </ul>
    </div>
  );
}

export default Profile;
